import React from 'react';
import { connect } from 'react-redux';
import { actions } from '../Redux/Store/actions';
import { compose } from "redux";
import { withRouter } from 'react-router-dom';

const mapDispatchToProps = (dispatch) => ({
    setDataTable: (data) => dispatch(actions.setDataTable(data)),
})


function mapStateToProps(state) {
    return {
        dataTable: state.userReducer.dataTable
    }
}
export default compose(withRouter, connect(mapStateToProps, mapDispatchToProps))(function TableDynamic(props) {
    const { dataTable,setDataTable } = props;
    function getAllData() {
        fetch("http://localhost:3001/getUser", {
            method: "get",
            headers: { "Content-Type": "application/json" },
        })
            .then(res => res.json())
            .then((data) => {
                console.log(data)
                setDataTable(data);
            })
            .catch(err => console.log(err))
    }
    return (
        <>
            <br />
            <button type="button" class="btn btn-outline-primary" onClick={getAllData}>Click me</button>
           <br/><table class="table">
                <thead class="thead-primary">
                    <tr>
                        <th scope="col">#</th>
                        <th scope="col">First</th>
                        <th scope="col">Last</th>
                        <th scope="col">Handle</th>
                    </tr>
                </thead>
           {dataTable.forEach(element => {
            let arr = []
            Object.keys(element).forEach(key => arr.push({name: key, value: element[key]}))
               
           })}
            
                <tbody>
                    <tr>
                        <th scope="row">1</th>
                        <td>Mark</td>
                        <td>Otto</td>
                        <td>@mdo</td>
                    </tr>
                </tbody>
            </table>
        </>
    )
})
